@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'mindbalance';
}
<div>
  <div
    class="fbzKiw"
    style="
      background: linear-gradient(
        90deg,
        rgb(140, 82, 255) 0%,
        rgb(92, 225, 230) 100%
      );
    "
  >
  <div class="form">
    <div class="mb3">
      <div class="titulo">
        <h3 class="title">MIND BALANCE</h3>
      </div>
      <input class="id" placeholder="Identificación" />
    </div>
  </div>
  </div>
</div>
